import { StatusBar } from 'expo-status-bar';
import React, { Component } from 'react';
import { 
  StyleSheet, 
  Text, 
  View, 
  Image, 
  Button
} from 'react-native';
import Deck from './src/Deck';

const DATA = [
  { id: 1, text: 'Card #1', uri: 'data:image/jpeg;base64,' },
  { id: 2, text: 'Card #2', uri: 'data:image/jpeg;base64,' },
  { id: 3, text: 'Card #3', uri: 'data:image/jpeg;base64,' },
  { id: 4, text: 'Card #4', uri: 'data:image/jpeg;base64,' },
  { id: 5, text: 'Card #5', uri: 'data:image/jpeg;base64,' },
  { id: 6, text: 'Card #6', uri: 'data:image/jpeg;base64,' },
  { id: 7, text: 'Card #7', uri: 'data:image/jpeg;base64,' },
  { id: 8, text: 'Card #8', uri: 'data:image/jpeg;base64,' },
];

class App extends Component {
  renderCard (item) {
    return (
      <View 
        style={styles.card}
        key={item.id}  
      >
        <Image
          style={styles.img} 
          source={{ uri: item.uri }}
        />
        <Text>{item.text}</Text>
        <Text>It can be customized further.</Text>
        <Button 
          title="View now!"
          style={{ margin: 10 }}
        />
      </View>
    )
  }

  renderNoMoreCards () {
    return (
      <View 
        style={styles.card}
      >
        <Image
          style={styles.img} 
        />
        <Text>No more Cards to display</Text>
        <Button 
          title="View now!"
          style={{ margin: 10 }}
        />
      </View>
    )
  }

  render () {
    return (
      <View style={styles.container}>
        <Deck 
          data={DATA}
          renderCard={this.renderCard}
          renderNoMoreCards={this.renderNoMoreCards}
        />
      </View>
    );
  }
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff'
  },
  img: {
    height: 250
  },
  card: {
    marginHorizontal: 10,
    marginTop:10,
    borderWidth: 1,
    padding: 5
  }
});

export default App;
